import React from "react";
import { Link } from "react-router-dom";

const KidsRides = () => {
  return (
    <section className="bg-white h-screen flex items-center justify-center">
      <div className="container h-full pb-14 pt-16 flex flex-col">
        <h1 className="text-4xl font-bold text-left pb-10">Kids Rides</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
          {/* Ride 1 */}
          <div className="bg-[#f4f4f4] rounded-2xl flex flex-col items-center p-4 py-7">
            <img src="data:image/jpeg;base64," alt="Kids Ride 1" className="w-full h-48 object-cover rounded" />
            <h2 className="text-lg font-semibold text-center px-3">Mini Ferris Wheel</h2>
            <p className="text-center px-3">A smaller version of the classic Ferris wheel, designed for little ones!</p>
            <Link to="/cart" className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Add to Cart</Link>
          </div>
          {/* Ride 2 */}
          <div className="bg-[#f4f4f4] rounded-2xl flex flex-col items-center p-4 py-7">
            <img src="data:image/jpeg;base64," alt="Kids Ride 2" className="w-full h-48 object-cover rounded" />
            <h2 className="text-lg font-semibold text-center px-3">Bouncy Castle</h2>
            <p className="text-center px-3">Jump around and have fun in our safe and colorful bouncy castle!</p>
            <Link to="/cart" className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Add to Cart</Link>
          </div>
          {/* Ride 3 */}
          <div className="bg-[#f4f4f4] rounded-2xl flex flex-col items-center p-4 py-7">
            <img src="data:image/jpeg;base64," alt="Kids Ride 3" className="w-full h-48 object-cover rounded" />
            <h2 className="text-lg font-semibold text-center px-3">Toy Train</h2>
            <p className="text-center px-3">A fun and slow ride around the park on our adorable toy train!</p>
            <Link to="/cart" className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Add to Cart</Link>
          </div>
        </div>
      </div>
    </section>
  );
};

export default KidsRides;
